import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
  return (
    <div className="App">
      <Container />
    </div>
  );
}
function Container() {
  return (
    <div className="container">
      <DevImg />
      <DevName />
      <BIO />
      <SkillsContainer />
    </div>
  );
}

function DevImg() {
  return (
    <div className="image-wrapper">
      <img className="image" src="./images/image.jpg" alt="Developer" />
    </div>
  );
}

function DevName() {
  return (
    <header className="header-wrapper">
      <h1 className="header">Nono Piralishvili</h1>
    </header>
  );
}

function BIO() {
  return (
    <div className="bio-wrapper">
      <p className="bio">
        I'm a fast learning, ambitious and hard working individual with high
        sense of responsibility. I'm always open to new challenges and strive
        for gaining new skills and experiences in various fields.
      </p>
    </div>
  );
}

function SkillsContainer() {
  return (
    <div className="skill-set">
      <div className="set-1">
        <Skills skillName="HTML + CSS" style={{ backgroundColor: "blue" }} />
        <Skills />
      </div>
      <div className="set-2">
        <Skills />
        <Skills />
      </div>
      <div className="set-3">
        <Skills />
        <Skills />
      </div>
    </div>
  );
}

function Skills(props) {
  return (
    <div className="skill-wrapper" style={props.style}>
      <p className="skill">
        <b>{props.skillName}</b>
      </p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
